import React from "react";

class Tip extends React.Component {
  constructor() {
    super();
    this.state = {
      userwallet: 0,
      bandwallet: 0,
      tipamount: 0
    };
  }
  componentDidMount() {}
  render() {
    return <></>;
  }
}
export default Tip;
